import "./partners-section.css";

const PartnersSection = () => {
  return (
    <div className="frame-parent2">
      <div className="image-13-parent">
        <img className="image-13-icon" alt="" src="../image-13@2x.png" />
        <img className="image-15-icon" alt="" src="../image-15@2x.png" />
        <img className="image-15-icon1" alt="" src="../image-15@2x.png" />
        <img className="image-16-icon" alt="" src="../image-15@2x.png" />
        <img className="image-17-icon" alt="" src="../image-15@2x.png" />
        <img className="image-15-icon2" alt="" src="../image-13@2x.png" />
        <img className="image-14-icon" alt="" src="../image-13@2x.png" />
        <img className="image-15-icon3" alt="" src="../image-15@2x.png" />
      </div>
      <div className="partners-of-takk">Partners of TAKK</div>
    </div>
  );
};

export default PartnersSection;
